INSERT INTO `qb_reply` VALUES ('714','','0','703','44','1','1','<p style=\"margin:10px 0cm auto\"><strong><span style=\"color:#c00000;font-size:16px\">技术支持</span></strong></p><p style=\"margin:10px 0cm auto\"><strong>1、轴承设计优化</strong></p><p style=\"margin:10px 0cm auto\">我们能在早期对您的轴承设计进行设计优化，尽可能的让轴承的设计趋于完美。</p><p style=\"margin:10px 0cm auto\"><strong>2、故障查找</strong></p><p style=\"margin:10px 0cm auto\">我们的技术团队可以为您查找在使用过程中出现的故障，找到解决方案，尽最大限度延长轴承的使用寿命。</p><p style=\"margin:10px 0cm auto\"><strong>3、提供进口轴承替代</strong></p><p style=\"margin:10px 0cm auto\">我们有多年的进口轴承生产经验，我们的技术团队可以根据您的机械设备使用情况提供进口轴承替代产品。</p><p style=\"margin:10px 0cm auto\"><strong>4、技术咨询与培训</strong></p><p style=\"margin:10px 0cm auto\">为客户提供轴承方面知识的咨询与培训。</p><p style=\"margin:5px 0cm 16px\">&nbsp;</p><p style=\"margin:5px 0cm 16px\"><span style=\"font-family:宋体;color:#b20000;font-size:24px\"><strong><span style=\"font-size:large\"><span style=\"font-family:宋体;font-size:16px\">轴承维修</span></span></strong></span></p><p style=\"margin:0cm 0cm 13px\"><strong>1、为延长轴承使用寿命协助机械改造</strong></p><p style=\"margin:0cm 0cm 13px\">我们的技术团队可以现场提供技术支持，协助您进行机械改造，最大限度的延长轴承使用寿命，降低企业的生产运行成本。</p><p style=\"margin:0cm 0cm 13px\"><strong>2、配合现场轴承安装和拆卸</strong></p><p style=\"margin:0cm 0cm 13px\">我们的工程师可以亲临现场提供技术支持，现场配合轴承的安装和拆卸。</p><p style=\"margin:0cm 0cm 13px\"><strong>3、轴承翻修服务</strong></p><p style=\"margin:0cm 0cm 13px\">我们是国内首家推出轴承翻修服务的厂家，为客户进行进口轴承和中大型轴承的翻修服务，已经为国内数家大型水泥、造纸、冶炼等企业提供轴承翻修服务。</p><p style=\"margin:0cm 0cm 13px\"><strong>为何翻修轴承？</strong></p><p style=\"margin:0cm 0cm 13px\">--为客户降低成本增加效益；</p><p style=\"margin:0cm 0cm 13px\">--可延长轴承和机器的使用寿命；</p><p style=\"margin:0cm 0cm 13px\">--导致库存减少；</p><p style=\"margin:0cm 0cm 13px\">--损坏分析，为改善产品提供应用反馈。</p><p style=\"margin:0cm 0cm 13px\">&nbsp;</p><p style=\"margin:0cm 0cm 13px\">&nbsp;</p><p>&nbsp;</p>','0');
